import {Link} from "react-router-dom";
import { NavBar, Heading, Back, Image, OneThirdDiv } from "./task-nav.styles"
import backArrow from "../../assets/backArrow.png"

export const TaskNav = ({title}) => {
    return (
        <NavBar>
        <OneThirdDiv>
          <Hamburger />
        </OneThirdDiv>
        <OneThirdDiv>
          <Heading> {title} </Heading>
        </OneThirdDiv>
        <OneThirdDiv>
          <AddProjectDiv>
            &times;
          </AddProjectDiv>
        </OneThirdDiv>
      </NavBar>
    )
}
